  \"2016-07-27T22:42:05.424201\",\n\t\"name\": \"great-lakes-contaminant-impacts-study-residue-analysis-report-on-selected-pcb-isomers-in-c\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The status of environmental contamination
  and its possible effects on living resources in the St. Lawrence River and Niagara
  River ecosystems has been the subject of continuing interest and study by the U.S.
  Fish & Wildlife Service's New York Field Office. Towards that end, this study was
  conducted to: (1) determine concentrations of selected dioxin-like polychlorinated
  biphenyls (PCBs) in Common Tern (Sterna hirundo) eggs collected in lower Great Lakes
  ecosystems, and (2) assess the potential risk to fish-eating birds in the ecosystem
  from exposure to PCBs in terms of equivalent 2,3,7,8-tetrachlorodibenzo-p-dioxin
  (TCDD) toxicity.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
